import React, { useEffect, useState } from "react";
import API from "../api/api";

function ProductManagement() {
  const [products, setProducts] = useState([]);
  const [newProduct, setNewProduct] = useState({ title: "", price: "" });
  const [editingProduct, setEditingProduct] = useState(null);

  useEffect(() => {
    loadProducts();
  }, []);

  const loadProducts = async () => {
    try {
      const res = await API.get("/products");
      setProducts(res.data);
    } catch (err) {
      console.error(err);
      alert("Failed to fetch products");
    }
  };

  const handleAddOrUpdate = async () => {
    if (!newProduct.title || newProduct.price === "") {
      alert("Please enter both title and price");
      return;
    }

    try {
      if (editingProduct) {
        // Update
        await API.put(`/products/${editingProduct.id}`, {
          title: newProduct.title,
          price: parseFloat(newProduct.price),
        });
        setEditingProduct(null);
      } else {
        // Add
        await API.post("/products", {
          title: newProduct.title,
          price: parseFloat(newProduct.price),
        });
      }
      setNewProduct({ title: "", price: "" });
      loadProducts();
    } catch (err) {
      console.error(err);
      alert("Failed to add/update product");
    }
  };

  const handleEdit = (product) => {
    setEditingProduct(product);
    setNewProduct({ title: product.title, price: product.price });
  };

  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure?")) return;
    try {
      await API.delete(`/products/${id}`);
      loadProducts();
    } catch (err) {
      console.error(err);
      alert("Failed to delete product");
    }
  };

  return (
    <div style={{ padding: 30 }}>
      <h2>Product Management</h2>

      {/* Input form */}
      <div style={{ marginBottom: 20 }}>
        <input
          placeholder="Product Title"
          value={newProduct.title}
          onChange={(e) => setNewProduct({ ...newProduct, title: e.target.value })}
          style={{ marginRight: 10, padding: 5 }}
        />
        <input
          placeholder="Price"
          type="number"
          value={newProduct.price}
          onChange={(e) => setNewProduct({ ...newProduct, price: e.target.value })}
          style={{ marginRight: 10, padding: 5 }}
        />
        <button onClick={handleAddOrUpdate}>
          {editingProduct ? "Update Product" : "Add Product"}
        </button>
      </div>

      {/* Products table */}
      <table border="1" cellPadding="10" style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr style={{ background: "#f0f0f0" }}>
            <th>ID</th>
            <th>Title</th>
            <th>Price</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map((p) => (
            <tr key={p.id}>
              <td>{p.id}</td>
              <td>{p.title}</td>
              <td>${p.price.toFixed(2)}</td>
              <td>
                <button onClick={() => handleEdit(p)} style={{ marginRight: 5 }}>
                  Edit
                </button>
                <button onClick={() => handleDelete(p.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ProductManagement;
